                    try {
                        $searcher = New-Searcher
                        $searcher.Filter = "(&(objectCategory=user)(samAccountName=$Username))"
                        $searcher.PropertiesToLoad.AddRange(@("samAccountName"))
                        $user = $searcher.FindOne()
