                            -NameLength $NameLength `
                            -OSLength $OSLength
                        Append-BHQuery -ComputerName $($runspace.ComputerName.Split('.')[0]) `
                            -Domain $Domain `
                            -ComputerOwned
                        Append-BHQuery -ComputerName $($runspace.ComputerName.Split('.')[0]) `
