        try {
            
            $Content = Get-Content -Path $BackupFile.FullName -Raw -ErrorAction "Stop"

            Write-Output "File Path: $($BackupFile.FullName)"
            Write-Output ""
            Write-Output $Content
            Write-Output "========================================================================================="
        
        } catch {}
    }
}

function Get-Notepad {
